import './App.css';
import Header from './components/Header';
import Navbar from './components/Navbar';
import Profile from './components/Profile';


//компонента App
function App() {
	return (
		<div className="app-wrapper">
			<Header />
			<Navbar />
			<Profile />
		</div>
	);
}

export default App;
